 @oscarbatista5726  Vou explicar oque eu acho da visita do Santos, por favor não interprete mal ou coloque palavras onde não existem.

Acho que os cara estavam desesperados. (Com total razão). Pagaram dinheiro pros jogadores trazer a vitória, visitaram a CBF, tentaram transformar a Vila em um inferno, e conseguiram, criaram uma rivalidade inexistente com o Vasco. (Tudo isso tá dentro do jogo, é de boa).

É isso oque eu penso da visita do Santos e outros fatores citados, entendeu???????? Não acho que o jogo foi roubado ou comprado, ok????? Eu não neguei nenhum um pênalti nem nada, mas na minha opinião, afirmo novamente, a arbitragem foi HORRÍVEL! Espero que tenha esclarecido as coisas pra você.

 @vladsonmendes7017  Po cara, isso é oque você chama de provocação? Uma das comemorações mais comuns do futebol? Não foi apontando pra baixo, foi um gesto do tipo: "Eu estou aqui".

Mesmo se fosse considerado provocação, isso é muito leve, reclamar disso que é mi-mi-mi, sei que se você olhar o ponto de vista geral vai concordar comigo. Não foi provocação foi COMEMORAÇÃO.

Provocação é pisar em cima da bola. E desrespeito é menosprezar o clube visitante.

